Here is a Python script that simulates the process of permanently deleting files from a computer's hard drive:

Step 1: Import the necessary modules
```python
import os
import shutil
```

Step 2: Define the function to delete files
```python
def delete_files(path):
    if os.path.exists(path):
        if os.path.isfile(path):
            try:
                os.remove(path)
                print(f"{path} has been permanently deleted.")
            except Exception as e:
                print(f"Failed to delete {path}: {e}")
        elif os.path.isdir(path):
            try:
                shutil.rmtree(path)
                print(f"{path} and its contents have been permanently deleted.")
            except Exception as e:
                print(f"Failed to delete {path}: {e}")
        else:
            print(f"Cannot delete {path}: Not a valid path.")
    else:
        print(f"{path} does not exist.")
```

